import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Provider } from 'react-redux';
import { BrowserRouter } from 'react-router-dom';
import store from './redux/store/store';
import { Auth0Provider } from "@auth0/auth0-react";
import { PayPalScriptProvider } from "@paypal/react-paypal-js";

const options = {
   logo: "https://res.cloudinary.com/dmv0gnlcu/image/upload/v1679787401/Tex_logos/LOGO_MINIMAL_euywjz.png",
   // otras opciones de configuración de Auth0...
 };
 
ReactDOM.render(
  <Provider store={store}>
     <React.StrictMode>
        <PayPalScriptProvider options={{ "client-id": "Aa9SaYMRYI92HMqajFUqG9WSm1CVI3s4nOoyT-F58UXV0WRJQBNeJgVpRe46xfXepr430pElNvgcvj2Q" }}>
      <Auth0Provider
      domain="dev-7wln408r6z54drbc.us.auth0.com"
      clientId="uKUn6EjbNFacbwJYWQrRdqzJHhUTi0i0"
      redirectUri={window.location.origin}
      options={options}

      >
         <BrowserRouter>
            <App />
         </BrowserRouter>
      </Auth0Provider>
       </PayPalScriptProvider>
     </React.StrictMode>
  </Provider>
  ,
  document.getElementById('root')
);
